    false,nt"url": null,nt"notes": "This narrative report for Slade National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1960.
    The report begins by summarizing the weather conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, predators, rodents,
    mammals, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and collections and receipts. Resource management
    is outlined; topics include grazing, haying and fur harvesting. Report includes
    a field investigation report. The public relations section of the report describes
    Refuge visitors, public use and refuge participation, violations, and hunting. Items
    of interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
